import './App.css';
import Login from './Pages/Login';
import {Route, Routes} from 'react-router-dom'
import Button from './components/'



function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Login/>}/>
        <Route path='/about' element={<Login/>}/>

      </Routes>
      <Login/>
    </div>
  );
}

export default App;
